import './Navbar.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return(
    <div className="navbar">
      
      <Link to="/">
        <img className="logo" src="webshio.png" alt=""/>
      </Link>
      <Link to="add-item"> Esemed
        <img className="item" src="add.svg" alt=""/>
      </Link>
      <Link to="add-category"> Kategooria
        <img className="category" src="category.png" alt=""/>
      </Link>
      <Link to="cart"> Ostukorv
        <img className="cart" src="cart.svg" alt=""/>
      </Link>
    </div>
  );
}


export default Navbar
